def primeChecker(numbers):
    prime = []
    nonprime = []
    for num in numbers:
        if num >= 1:
            for i in range(2, int(math.sqrt(num)) + 1):
                if num % i == 0:
                    nonprime.append(num)
                    break
            else:
                prime.append(num)
    return (prime, nonprime)

